const Home = () => {

    return (
        <div className="container home" >
            <div>
                <div className="container" id="home" style={{ marginTop: 150,  color: 'white'}}>
                    <p>Welcome to Gemesis</p>
                </div>
            </div>
        </div>
    );
}

export default Home;
